import React from 'react';
import { Minus, MinusCircle } from 'react-feather';
import { default as tailwind } from '../../tailwind.config.js';

const TemplateOne = ({ className }: { className: string }) => {
	return (
		<div
			className={'bg-tertiary-bg ' + className}
			style={{ width: '728px', height: '100px' }}
		>
			<div className="w-full h-full p-4 flex items-center justify-between">
				<div className="flex items-center gap-6 h-full">
					<img
						className="rounded-full h-full"
						src="https://cdn.discordapp.com/avatars/670427777757085730/999b6917c1912a51b4c7e1b05f21cee9.png?size=256"
					/>
					<div>
						<h3 className="text-secondary-text font-medium">RiznSun#7591</h3>
						<span className="font-normal flex items-center text-red-500">
							<div
								className="w-5 h-5 bg-red-500 rounded-full mr-2 font-mono flex place-items-center"
								style={{}}
							>
								<Minus
									color={tailwind.theme.colors['black-400']}
									strokeWidth={3}
								/>
							</div>
							Do Not Disturb
						</span>
					</div>
				</div>
				<div className="">
					<div className="bg-quartiary-bg p-3 rounded-md">
						<p className="font-bold flex items-center gap-3">
							Status{' '}
							<span className="font-normal flex items-center">
								<div
									className="w-5 h-5 bg-red-500 rounded-full mr-2 font-mono flex place-items-center"
									style={{}}
								>
									<Minus color={'black'} strokeWidth={3} />
								</div>
								Do Not Disturb
							</span>
						</p>
					</div>
				</div>
			</div>
		</div>
	);
};

export default TemplateOne;
